import React, { Component } from "react";

class Form extends Component {
  render() {
    return (
      <div>
        <h1>Forma ideale</h1>
        <label>Ime</label>
        <input type="text" />
        <label>mail</label>
        <input type="email" />
        <label>password</label>
        <input type="password" />
        <label>URL</label>
        <input type="url" />
      </div>
    );
  }
}

export default Form;
